import './estilo.css'
const textoCategorias = ['Categorias', 'Favoritos', 'Minha Estante']

function OpcoesHeader(){
    return(
        <ul className='opcoes'>
              {textoCategorias.map((texto) =>(
                <li><p>{texto}</p></li>
              ))}
            </ul>
    )
}

export default OpcoesHeader
